import React, { useEffect, useState } from 'react';
import "./home.css";


function Home() {
    return (
        <div className="home">
            <img src={require("../img/globe.png")} width="350px" alt="globe" />
            <div className='right-intro'>
                <div className='center medium-width'>
                    <h1>Country News App</h1>
                    <p>Explore the local news of countries around the world, and filter articles to find the one you want.</p>
                    <button>Get Started</button>
                </div>
            </div>
        </div>
    )
}

export default Home;
